        [color=#f39f27]░░▄▀░░ [head=2]Engineering Memo[/head]

        ░▄█▄▄▀ [head=3]Subject: Station Integrity and Power  [/head]

        ██▀░░░ [head=3]From: Upper Management  [/head]

        [/color]─────────────────────────────────────
            Special circumstances may require untrained staff to maintain delicate assets such as the supermatter crystal. Though Cluster Station's installation requires minimal intervention, the need for manual adjustment of some equipment is unavoidable. Rest assured that adequate personal protective equipment and instructions may be found within the engineering department.

        In order to ensure the crew aboard this vessel are healthy enough to perform expected tasks, it is advised that the radiation collectors be [bold]regularly refilled[/bold] with tanks of gaseous plasma at standard atmospheric pressure and temperature. Additionally, it is of the utmost importance that the station's air distribution and waste management systems are enabled.


        Failure to adhere to this may result in injury, death, and a large deduction from your paycheck. 

        ────────────────────────────────────

        [italic]Sincerely[/italic], Upper Management
